	public void setIdSamu(String idSamu) {
		if (epi != null) {
			for (EPI ep : epi) {
				ep.setIdSamu(idSamu);
			}
		}
		
		String currentId = getIdAff();
		
		String prefix = idSamu + "-";
		if (!currentId.startsWith(prefix)) {
			setIdAff(prefix + currentId);
		}
	}

